import React, { useState, useEffect } from 'react';
import './App.css';
import NavBar from './Components/NavBar';
import Inputs from './Components/Inputs';
import Meter from './Components/Meter';
import Table from './Components/Table'; // ✅ Capital T

function App() {
  const [message, setMessage] = useState('');
  const [passCourses, setPassCourses] = useState([]);
  const [suggestedSubjects, setSuggestedSubjects] = useState([]);

  useEffect(() => {
    fetch('http://127.0.0.1:5000/api/hello')
      .then(response => response.json())
      .then(data => setMessage(data.message));
  }, []);

  return (
    <div className="App">
      <NavBar />
      <div className="Inputs">
        <Inputs
          setPassCourses={setPassCourses}
          setSuggestedSubjects={setSuggestedSubjects}
        />
      </div>
      <div className="Meter">
        <Meter />
        <p>{message}</p>
      </div>
      <div className="Table">
        <Table passCourses={passCourses} suggestedSubjects={suggestedSubjects} />
      </div>
    </div>
  );
}

export default App;
